import React from 'react';

function Contact(props) {
    return(
        <div className='subscribe'>
            <h3>My Connectible Accounts</h3>
            <div className='subscribe-input'>
            <input type='email' placeholder='exp'/>
            </div>
        </div> 
    )
}

export default Contact;
